import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './components/Homepage';
import PumpDetail from './components/PumpDetail'; // Import the PumpDetail component

const App = () => {
    return (
        <Router>
            <Switch>
                <Route path="/pump/:pumpId" component={PumpDetail} />
                {/* Other routes */}
            </Switch>
        </Router>
    );
}


export default App;
